pub struct Solution;

const MAX_MOD: i64 = 1_000_000_007;

#[allow(dead_code)]
impl Solution {
  pub fn possible_string_count(word: String, k: i32) -> i32 {
    if word.len() <= k as usize {
      return 1;
    }

    let mut groups: Vec<i32> = Vec::new();
    let chars: Vec<char> = word.chars().collect();
    let mut prev_c = chars[0];
    let mut rp_count: i32 = 1;

    for &c in chars[1..].iter() {
      if c == prev_c {
        rp_count += 1;
      } else {
        groups.push(rp_count);
        rp_count = 1;
      }
      prev_c = c;
    }
    groups.push(rp_count);

    let mut any_length_combinations: i64 = 1;
    for &chars_count in groups.iter() {
      let chars_count64 = chars_count as i64;
      any_length_combinations = (any_length_combinations * chars_count64) % MAX_MOD;
    }

    if k <= groups.len() as i32 {
      return any_length_combinations as i32;
    }

    let k_from: i32 = groups.len() as i32;
    let k_to: i32 = k - 1;

    let mut baskets: Vec<(i32, i32)> = Vec::new();
    let mut total_capacity: i32 = 0;
    for chars_count in groups.into_iter() {
      let capacity: i32 = chars_count;
      total_capacity += capacity;
      baskets.push((capacity, total_capacity));
    }

    let mut d_prev: Vec<i32> = vec![0; k_to as usize + 1];
    let mut d_curr: Vec<i32> = vec![0; k_to as usize + 1];

    let mut s_prev: Vec<i64> = vec![0; k_to as usize + 1]; // Prefix sum array previous
    let mut s_curr: Vec<i64> = vec![0; k_to as usize + 1]; // Prefix sum array current

    for (i, &(cap, tcap)) in baskets.iter().enumerate() {
      for n in (i + 1)..(tcap.min(k_to) as usize + 1) {
        if i == 0 {
          d_curr[n] = 1;
        } else {
          let from: usize = (1.max(n as i32 - cap) as usize) - 1;
          let to: usize = n - 1;
          d_curr[n] = ((s_prev[to] + MAX_MOD - s_prev[from]) % MAX_MOD) as i32;
        }
      }

      for n in (i + 1)..(k_to as usize + 1) {
        s_curr[n] = (s_curr[n - 1] + d_curr[n] as i64) % MAX_MOD;
      }

      d_prev = d_curr;
      d_curr = vec![0; k_to as usize + 1];

      s_prev = s_curr;
      s_curr = vec![0; k_to as usize + 1];
    }

    let mut less_than_k_combinations: i64 = 0;
    for k in k_from..k_to + 1 {
      less_than_k_combinations = (less_than_k_combinations + d_prev[k as usize] as i64) % MAX_MOD;
    }

    ((any_length_combinations + MAX_MOD - less_than_k_combinations) % MAX_MOD) as i32
  }
}

#[cfg(test)]
mod tests {
  use super::*;

  #[test]
  fn test_example1() {
    assert_eq!(
      Solution::possible_string_count("aabbccdd".to_string(), 7),
      5
    );
  }

  #[test]
  fn test_example2() {
    assert_eq!(
      Solution::possible_string_count("aabbccdd".to_string(), 8),
      1
    );
  }

  #[test]
  fn test_example3() {
    assert_eq!(Solution::possible_string_count("aaabbb".to_string(), 3), 8);
  }

  #[test]
  fn test_example3b() {
    assert_eq!(Solution::possible_string_count("aaabbb".to_string(), 2), 9);
  }

  #[test]
  fn test_example3c() {
    assert_eq!(Solution::possible_string_count("aaabbbb".to_string(), 4), 9);
  }

  #[test]
  fn test_example4() {
    assert_eq!(Solution::possible_string_count("d".to_string(), 1), 1);
  }

  #[test]
  fn test_example5() {
    assert_eq!(Solution::possible_string_count("".to_string(), 1924), 756148912);
  }

  #[test]
  fn test_example6() {
    assert_eq!(
      Solution::possible_string_count("".to_string(), 1292), 101346905
    );
  }

  #[test]
  fn test_example7() {
    assert_eq!(
      Solution::possible_string_count("".to_string(), 2000), 98001
    );
  }

  #[test]
  fn test_example8() {
    assert_eq!(Solution::possible_string_count("".to_string(), 1990), 366105525);
  }
}
